import React, { useState, useEffect } from 'react';
import { obtenerMunicipalidades, obtenerDirectores, crearColegio } from '../../services/administradorService';

function CrearColegio() {
    const [nombre, setNombre] = useState('');
    const [direccion, setDireccion] = useState('');
    const [telefono, setTelefono] = useState('');
    const [directorId, setDirectorId] = useState('');
    const [directores, setDirectores] = useState([]);
    const [municipalidadId, setMunicipalidadId] = useState('');
    const [municipalidades, setMunicipalidades] = useState([]);
    const [errorMessage, setErrorMessage] = useState('');

    useEffect(() => {
        const fetchMunicipalidades = async () => {
            try {
                const response = await obtenerMunicipalidades();
                setMunicipalidades(response);
            } catch (error) {
                console.error("Error al obtener las municipalidades:", error);
                setErrorMessage("No se pudieron cargar las municipalidades.");
            }
        };
        fetchMunicipalidades();
    }, []);

    useEffect(() => {
        const fetchDirectores = async () => {
            try {
                const response = await obtenerDirectores();
                setDirectores(response);
            } catch (error) {
                console.error("Error al obtener los directores:", error);
                setErrorMessage("No se pudieron cargar los directores.");
            }
        };
        fetchDirectores();
    }, []);

    const handleSubmit = async (event) => {
        event.preventDefault();
        try {
            const colegioData = {
                nombre,
                direccion,
                telefono,
                director: directorId,
                municipalidad: municipalidadId
            };
            await crearColegio(colegioData);
            setNombre('');
            setDireccion('');
            setTelefono('');
            setDirectorId('');
            setMunicipalidadId('');
            alert("Colegio creado con Ã©xito");
        } catch (error) {
            console.error("Error al crear el colegio:", error);
            setErrorMessage("Error al crear el colegio. Intente nuevamente.");
        }
    };

    return (
        <form onSubmit={handleSubmit}>
            {errorMessage && <p className="error-message">{errorMessage}</p>}
            <div>
                <label htmlFor="nombre">Nombre:</label>
                <input
                    type="text"
                    id="nombre"
                    value={nombre}
                    onChange={(e) => setNombre(e.target.value)}
                    required
                />
            </div>
            <div>
                <label htmlFor="direccion">DirecciÃ³n:</label>
                <input
                    type="text"
                    id="direccion"
                    value={direccion}
                    onChange={(e) => setDireccion(e.target.value)}
                    required
                />
            </div>
            <div>
                <label htmlFor="telefono">TelÃ©fono:</label>
                <input
                    type="text"
                    id="telefono"
                    value={telefono}
                    onChange={(e) => setTelefono(e.target.value)}
                    required
                />
            </div>
            <div>
                <label htmlFor="director">Director:</label>
                <select
                    id="director"
                    value={directorId}
                    onChange={(e) => setDirectorId(e.target.value)}
                    required
                >
                    <option value="">Selecciona un director</option>
                    {directores.map((director) => (
                        <option key={director.id} value={director.id}>
                            {director.nombre}
                        </option>
                    ))}
                </select>
            </div>
            <div>
                <label htmlFor="municipalidad">Municipalidad:</label>
                <select
                    id="municipalidad"
                    value={municipalidadId}
                    onChange={(e) => setMunicipalidadId(e.target.value)}
                    required
                >
                    <option value="">Selecciona una municipalidad</option>
                    {municipalidades.map((municipalidad) => (
                        <option key={municipalidad.id} value={municipalidad.id}>
                            {municipalidad.nombre}
                        </option>
                    ))}
                </select>
            </div>
            <button type="submit">Crear Colegio</button>
        </form>
    );
}

export default CrearColegio;
